import React from "react";
import { Route, Routes, useNavigate } from "react-router-dom";
import FixtureDetails from "../FixtureDetails/FixtureDetails";

function Main({ selectedSport }) {
  const navigate = useNavigate();

  // This would be part of your logic to navigate to FixtureDetails
  const handleClick = (matchId) => {
    navigate(`/fixtures/${selectedSport}/${matchId}`);
  };

  return (
    <div>
      <h1>{selectedSport} Fixtures</h1>
      {/* Replace with actual fixture list */}
      <button onClick={() => handleClick(1)}>View Fixture 1</button>
      {/* Add more buttons or components to list fixtures */}
      <Routes>
        <Route path="/fixtures/:sport/:matchId" element={<FixtureDetails />} />
      </Routes>
    </div>
  );
}

export default Main;
